Earthquake (born Nathaniel Martin Stroman on May 29, 1963 in Washington, D.C.) is an American stand-up comedian and actor. He performed a half-hour HBO special as part of the series One Night Stand, which first aired on August 26, 2005. He also had a small role in Kevin Smith&amp;#039;s film Clerks II, released in July 2006. He has a recurring role as Chris&amp;#039; Uncle Mike, on Everybody Hates Chris.

Military career
Earthquake was in the U.S Air Force for eleven years. He refused to be a combatant in the Gulf War and was honorably discharged as a conscientious objector. He had attained the rank of Sergeant but was demoted to Airman First Class before his discharge.

Earthquake revealed on The Howard Stern Show that while he was in the U.S. Air Force, he once dropped a live nuclear missile when he was loading it into an aircraft. According to Earthquake, the incident caused much panic and was classified as a Broken Arrow, a situation that alerts a large portion of the military, including the President of the United States. He claimed he was rushing to attend a 2 Live Crew concert.
